SELECT On_Time_On_Time_Performance_2016_1.Div2AirportSeqID, On_Time_On_Time_Performance_2016_1.DistanceGroup, RANK() OVER (PARTITION BY On_Time_On_Time_Performance_2016_1.LateAircraftDelay ORDER BY On_Time_On_Time_Performance_2016_1.Year) AS win_2, RANK() OVER (PARTITION BY On_Time_On_Time_Performance_2016_1.AirlineID ORDER BY On_Time_On_Time_Performance_2016_1.DepDelayMinutes) AS win_3, ROW_NUMBER() OVER (PARTITION BY On_Time_On_Time_Performance_2016_1.Div1LongestGTime ORDER BY On_Time_On_Time_Performance_2016_1.Div1Airport) AS win_4, AVG(On_Time_On_Time_Performance_2016_1.TaxiOut) OVER (PARTITION BY On_Time_On_Time_Performance_2016_1.Carrier ORDER BY On_Time_On_Time_Performance_2016_1.WeatherDelay) AS win_5 FROM On_Time_On_Time_Performance_2016_1 WHERE On_Time_On_Time_Performance_2016_1.OriginAirportSeqID IS NOT NULL